        <div class="button-panel">
          <a id="playdataviz" class="waves-effect waves-light btn-large">Play</a>
        </div>
        <script>
          function animateColor(selection, color, duration, delay) {
            selection
              .transition().duration(duration).delay(delay)
              .attr("fill", color)
              .attr("stroke", color); 
          }

          function animateIn(selection, duration, delay) {
            selection
              .transition().duration(duration).delay(delay)
              .style("fill-opacity", .7)
              .style("stroke-opacity", 1);
          }

          function vizSetColor(selection, color) {
            selection
              .attr("fill", color)
              .attr("stroke", color);
          }

          var dataviz = d3.selectAll("#dataviz svg path")
            .style("fill-opacity", 0)
            .style("stroke-opacity", 0);

          var clicked = false;

          d3.select("#playdataviz").on('click', function() {
            if (clicked)
              return;

            clicked = true;
            
            var hood = d3.selectAll("#dataviz .Hood_3");
            var lights = d3.selectAll("#dataviz .Lights_4");
            var tires = d3.selectAll("#dataviz .Tires_2");
            var windows = d3.selectAll("#dataviz .Windows_1");
            var door = d3.selectAll("#dataviz .door_0");
            var allpaths = d3.selectAll("#dataviz path");

            vizSetColor(hood, GREEN);
            vizSetColor(lights, GREEN);
            vizSetColor(tires, GREEN);
            vizSetColor(windows, PURPLE);
            vizSetColor(door, PURPLE);
            

            var startTime = 0;
            animateIn(hood, 2000, startTime);

            startTime += 2000;

            animateIn(lights, 2000, startTime);
            animateIn(tires, 2000, startTime);
            animateColor(hood, RED, 2000, startTime);

            startTime += 2000;

            animateIn(windows, 2000, startTime);
            animateIn(door, 2000, startTime);
            animateColor(hood, PURPLE, 2000, startTime);
            animateColor(lights, PURPLE, 2000, startTime);
            animateColor(tires, PURPLE, 2000, startTime);

            startTime += 2000;

            allpaths.transition().duration(2000).delay(startTime)
              .style("fill-opacity", 0)
              .style("stroke-opacity", 0);

            startTime += 2000;

            setTimeout(function() {clicked = false; }, startTime);
          });
        </script>
    </div>

        <div class="button-panel">
          <a id="pathvizplay" class="waves-effect waves-light btn-large">Play</a>
        </div>
        <script>
          var pathclicked = false;
          var origTires = "rgba(12,0,255,0.600000)";
          var origTiresStroke = "rgb(12,0,255)";

          var rect = d3.selectAll("#pathviz svg").insert("rect",":first-child");
          rect
            .style("fill", "black")
            .style("width", "100%")
            .style("height", "100%");

          d3.select("#pathvizplay").on('click', function() {
            if (pathclicked)
              return;

            pathclicked = true; 

            var delayTime = 0;

            d3.selectAll("#pathviz path:not(.Tires_2)")
              .transition(2000).delay(delayTime)
              .style("fill-opacity", 0)
              .style("stroke-opacity", 0);

            d3.selectAll("#pathviz image")
              .transition(2000).delay(delayTime)
              .style("opacity", 0);

            delayTime += 2000;

            d3.selectAll("#pathviz .Tires_2")
              .transition(2000).delay(delayTime)
              .style("fill", "white")
              .style("stroke", "white");

            delayTime += 2000;

            d3.selectAll("#pathviz .Tires_2")
              .transition(2000).delay(delayTime)
              .style("stroke", RED);

            delayTime += 2000;

            d3.selectAll("#pathviz .Tires_2")
              .transition(2000).delay(delayTime)
              .style("stroke", "white")
              .style("fill-opacity", 0);

            delayTime += 2000;

            d3.selectAll("#pathviz .Tires_2")
              .transition(2000).delay(delayTime)
              .style("stroke", origTiresStroke)
              .style("fill-opacity", 1)
              .style("fill", origTires);

            d3.selectAll("#pathviz path:not(.Tires_2)")
              .transition(2000).delay(delayTime)
              .style("fill-opacity", 1)
              .style("stroke-opacity", 1);

            d3.selectAll("#pathviz image")
              .transition(2000).delay(delayTime)
              .style("opacity", 1);

            delayTime += 2000;

            setTimeout(function() {pathclicked = false; }, delayTime);
          });
        </script>

      <div class="button-panel">
          <a id="zoomplay" class="waves-effect waves-light btn-large">Play</a>
        </div>
      <script>
        var zoomclicked = false;
        d3.select("#zoomplay").on("click", function() {
          if (zoomclicked)
            return;

          zoomclicked = true;
          d3.selectAll("#zoomsidebyside svg").transition().duration(4000).attrTween("viewBox", function() {
            return function(t) {
              var width = Math.floor(966 / (1 + 3 * t));
              var height = Math.floor(1200 / (1 + 3 * t));
              return "0 0 " + width + " " + height;
            };
          });

          d3.selectAll("#zoomsidebyside svg").transition().duration(4000).delay(6000).attrTween("viewBox", function() {
            return function(t) {
              var width = Math.floor(966 / (1 + 3 * (1 - t)));
              var height = Math.floor(1200 / (1 + 3 * (1 - t)));
              return "0 0 " + width + " " + height;
            };
          });
          setTimeout(function() {zoomclicked = false; }, 10000);
        })
        </script>
